import { Container, Row, Col } from 'react-grid-system';


export default () => {
    return <div>
        <style global jsx>{`
        body {
          padding: 0;
          margin: 0;
            background: #FCF9E9;

        }
      `}</style>
        <div style={{ height: 70, backgroundColor: "red" }}>
            <Container>
                <Row>
                    <Col md={6} style={{ lineHeight: "70px" }}><img src="/logo.svg" /></Col>
                    <Col md={6} style={{ textAlign: "right", lineHeight: "70px" }}><a href="#">Terms of Use</a></Col>
                </Row>
            </Container>
        </div>
    </div>
}
